choices.text:
// Generate a new seed if none is specified
if (seed == null) {
	rnd.nextBytes(new byte[1]);
}
else {
	InputStream inputStream = seed.getInputStream();
	byte[] seedArray = FileCopyUtils.copyToByteArray(inputStream);
	// use only as much as the specified seed length
	if (seedArray.length > seedLength) {
		byte[] tmp = new byte[seedLength];
		System.arraycopy(seedArray, 0, tmp, 0, seedLength);
		seedArray = tmp;
	}
	rnd.setSeed(seedArray);
}

